export function generateFAQSchema(){const e=document.getElementById("faq-list");if(e?.querySelectorAll(".w-dyn-item").length>0){const t={"@context":"https://schema.org","@type":"FAQPage",mainEntity:Array.from(e.querySelectorAll(".w-dyn-item")).map((e=>{const t=e.querySelector(".faq_q"),n=e.querySelector(".faq_answer");return t&&n?{"@type":"Question",name:t.textContent.trim(),acceptedAnswer:{"@type":"Answer",text:n.textContent.trim()}}:null})).filter(Boolean)},n=document.createElement("script");n.type="application/ld+json",n.textContent=JSON.stringify(t),document.head.appendChild(n)}}